import React from 'react';
import CoursePlan from './CoursePlan';
import Chat from './Chat';
import LiveCam from './LiveCam';

const CoursePage = () => {
  return (
    <div>
      <CoursePlan />
      <Chat />
      <LiveCam />
    </div>
  );
}

export default CoursePage;
